Uri.description:
The URI of the file. Used to record the unique path of the file. File paths in Object Storage Service (OSS) and File Storage NAS (NAS) are supported.

**OSS**

oss://${bucket}/${path}

**NAS**

nas://${fileSystemId}/${path}

